gmd:identificationInfo.gmd:MD_DataIdentification.gmd:abstract.gco:CharacterString.#text:§This series of datasets comes as the Supplementary Datasets in manuscript "The sensory shark: high-quality morphological, genomic and transcriptomic data 
for the small-spotted catshark Scyliorhinus canicula reveal the molecular bases of sensory organ evolution in jawed vertebrates" accepted in MBE and available in BioRxiv doi 2024.05.23.595469 and is composed of: 
- SDataset1_EmbryoZscore.csv (csv file, ';' as separator: Z-scores for all genes in the comparison between embryonic stages) ;  
- SDataset2_EmbryoAutocorrelation.csv (csv file, ';' as separator: autocorrelation values for all genes in the comparison between embryonic stages) ; 
- SDataset2_cluster1.csv (csv file, ';' as separator: list of genes contained in cluster 1 with details of their Zscore and TPM in embryonic stages) ; 
- SDataset2_cluster2.1.csv (csv file, ';' as separator: list of genes contained in cluster 2.1 with details of their Zscore and TPM in embryonic stages) ; 
- SDataset2_cluster2.2.csv (csv file, ';' as separator: list of genes contained in cluster 2.2 with details of their Zscore and TPM in embryonic stages) ; 
- SDataset2_cluster2.3.csv (csv file, ';' as separator: list of genes contained in cluster 2.3 with details of their Zscore and TPM in embryonic stages) ; 
- SDataset2_cluster2.4.csv (csv file, ';' as separator: list of genes contained in cluster 2.4 with details of their Zscore and TPM in embryonic stages) ; 
- SDataset4-AdultZscore.csv (csv file, ';' as separator: Z-scores for all genes in the comparison between adult tissues) ;  
- SDataset5 including 25 files named SDataset5_*organs.csv: GOterm association analysis in each 25 adult tissues (csv files, ';' as separator) ;  
- SDataset6_videoFrontal (.mp4 file Video to see olfactory nerve, frontal view);  
- SDataset7_videoVentral (.mp4 file Video to see olfactory nerve, ventral view); 
- SDataset8 including SDataset8_AOL.csv, SDataset8_BrainOlf.csv and SDataset8_Eye.csv (csv file, ';' as separator: tables of the  Top-50 genes in the ampullae of Lorenzini (AOL); brain and olfactory epithelium; and eye, respectively); 
- SDataset9_allTPM.cvs (csv file, ';' as separator: Transcript Per Kilobase Million values (TPMs) for all genes and in all tissues) ; 
- SDataset10_allZscores.csv (csv file, ';' as separator: Z-scores for all genes in the comparison between all tissues).

